	let candle = record.current
	let Pi = Math.PI
	let D = 36
	let lB = 6


	variable.x.push(candle.close)
	if(variable.x.length > 2){
		variable.x.splice(0,1)
	}


	if(variable.x.length === 2){
		variable.ang = Math.sqrt(2) * Pi/lB
		variable.a1 = Math.exp(-variable.ang)
		variable.b1 = 2 * variable.a1 * Math.cos(variable.ang)
		variable.c2 = variable.b1
		variable.c3 = -variable.a1 * variable.a1
		variable.c1 = 1 - variable.c2 - variable.c3
		if(variable.filt.length < 2){
			variable.filt.push(0)
			variable.filt.push(0)
		}
		variable.filt.push((variable.c1 * (variable.x[1] + variable.x[0] )) / 2 + (variable.c2 * variable.filt[1]) + (variable.c3 * variable.filt[0]))
		if(variable.filt.length > 3 ) {
			variable.filt.splice(0,1)
		}
	}
    if(variable.filt.length > 2){
        variable.signal = variable.filt[1]
    }else{
        variable.signal = 0
    }

//set variable for color changes at the plotter
if(candle.close < variable.signal){
	variable.trend = -1
}else{
	variable.trend = 1
}

	//Functions

	function deg2rad(deg) {
		return deg * Pi / 180
	}

	let candle = record.current
	let Pi = Math.PI
	let D = 36
	let lB = 6

	if(variable.previousHP === undefined){
			variable.previousHP = 0
	}

	variable.x.push(candle.close)
	if(variable.x.length > 2){
		variable.x.splice(0,1)
	}

	variable.angle = deg2rad(360) / D
	variable.alpha1 = (1-Math.sin(variable.angle)) / (Math.cos(variable.angle))
	if(variable.x.length === 2){
		variable.HP = 0.5 * (1 + variable.alpha1) * (variable.x[1] - variable.x[0]) + variable.alpha1 * variable.previousHP
		variable.previousHP = variable.HP
	}else{
        variable.HP = 0
    }

